function PagesName() {
    return (
      <>
        <Form style={{width: 320,}}>
            <Form.Group className="mb-3">
              <Form.Label>Add a Place:</Form.Label>
              <Form.Control type="Name of Place" placeholder="Name of Place" />
            </Form.Group>
          </Form>
          
      </>
    );
  }
  
export default PagesName;
